import React, { useEffect, useRef ,useState} from 'react';
import * as d3 from 'd3';

const {input,config} = props

const exampleData = [
    {"Index1":1,"Index2":0.2,"Index3":0.1,"Index4":1,"Index5":0.9,"Index6":0.2},
    {"Index1":0.5,"Index2":0.3,"Index3":1,"Index4":1,"Index5":0.9,"Index6":1},
    {"Index1":0.1,"Index2":0.2,"Index3":0.4,"Index4":0.3,"Index5":0.2,"Index6":0.4},
    {"Index1":0.2,"Index2":1,"Index3":0.3,"Index4":0.1,"Index5":0.3,"Index6":0.2}
]

const origData = input?.input || exampleData
const title = "AMENITY"
const subTitle = "WEIGHT"
const width = config.width;
const height = width;
const ytickSize = "0.8em"
const xtickSize = "1em"
const margin = 50;
const innerRadius = 0.4;
const outerRadius = 1.1;
const radius = (height-(margin*2)) / 2;
const minValue = 0;
const maxValue = 0.6;
const axisLabelDistance =8;
const dataCircleRadius = 4.5;
const outerCircles = [10,15]

const IndexChart = () => {

  const ref = useRef(null);
  const [data, setData] = useState(null);

  useEffect(() => {
    if (!origData) return;
    const radarData = [];
    const indexList = Object.keys(origData[0])
    indexList.forEach((key) => {
      const dataArray = origData.map(d => d[key])
      const item = {
        name: key,
        min: d3.min(dataArray),
        max: d3.max(dataArray),
        mean: d3.mean(dataArray),
      }
      radarData.push(item)});
    setData([radarData]);
  },[origData]);

  useEffect(() => {
    if (!ref.current) return;
    if (!data) return;

    // Create the SVG
    const svg = d3.select(ref.current)
      .attr('width', width)
      .attr('height', height)
      .attr("viewBox", [-width / 2, -height / 2, width, height])
      .append('g')

    // Extract the categories and calculate the angle of each axis
    const categories = data[0].map((d => d.name));
    const angleSlice = (Math.PI * 2) / categories.length;

    // Scale for the radius
    const x = d3.scaleLinear()
      .domain([0, categories.length])
      .range([0, 2 * Math.PI]);

    const y = d3.scaleLinear()
      .domain([minValue, maxValue])
      .range([innerRadius*radius, radius]);

    // create axis
    const axis = svg.selectAll('.axis')
      .data(categories)
      .enter()
        .append('g')
        .attr('class', 'axis');

    //Draw x stick
    svg.append("g")
    .selectAll()
    .data(x.ticks())
    .join("g")
      .call(g => g.append("path")
          .attr("stroke", "white")
          .attr("stroke-opacity", 0.2)
          .attr("d", d => `
            M${d3.pointRadial(x(d), radius*innerRadius)}
            L${d3.pointRadial(x(d), radius*outerRadius)}
          `))
      .call(g => g.append("text")
          .attr("dy","0.35em")
          .attr("x", d => d3.pointRadial(x(d), radius*outerRadius + axisLabelDistance)[0]) 
          .attr("y", (d,i) => d3.pointRadial(x(d), radius*outerRadius + axisLabelDistance)[1])
          .attr("fill", "white")
          .style("font-size", xtickSize)
          .text(d => categories[d])
          .attr("transform", (d, i) => {
            const angle = (x(d)+Math.PI/2)*180/Math.PI;
            const position = d3.pointRadial(x(d), radius*outerRadius + axisLabelDistance)
            return `rotate(${angle}, ${position[0]}, ${position[1]})`;
          }));
    //Draw y stick
    svg.append("g")
    .attr("text-anchor", "middle")
    .selectAll()
    .data(y.ticks(4).reverse())
    .join("g")
      .call(g => g.append("circle")
        .attr("fill", "none")
        .attr("stroke", "currentColor")
        .attr("stroke-opacity", 0.2)
        .attr("r", y))
      .call(g => g.append("text")
        .attr("y", d => y(d))
        .attr("dy", "0.35em")
        .attr("fill", "currentColor")
        .style("font-size", ytickSize)
          .attr("fill","white")
          .attr("opacity", 0.3)
        .text((x, i) => `${x.toFixed(1)}`)
        .clone(true)
          .attr("y", d => -y(d)));

    // Draw outer circle
    outerCircles.forEach((d) => {
    svg.append("circle")
      .attr("r", radius*outerRadius+d)
      .attr("cx", 0)
      .attr("cy", 0)
      .attr("stroke", "white")
      .style("fill-opacity", 0)
      .attr("stroke-width", 0.5)
      .attr("opacity", 0.7)
    });

    // Draw stakeholder
    const draw_stakeholder = (start, end, offset, text, color) => {
      const arc_offset = 10
      const text_offset = 15;
      svg.append("path")
        .attr("d", () => `
              M${d3.pointRadial(x(start), radius+arc_offset)}
              A${radius+arc_offset},${radius+arc_offset} 0,0,1 ${d3.pointRadial(x(end), radius+arc_offset)}
            `)
        .attr("stroke", color)
        .attr("stroke-width", 2)
        .attr("stroke-opacity", 0.6)
        .style("fill", "none");
      svg.append("path")
        .attr("id", 'textPath_'+text)
        .attr("d", () => `
              M${d3.pointRadial(x(start), radius+text_offset)}
              A${radius+text_offset},${radius+text_offset} 0,0,1 ${d3.pointRadial(x(end), radius+text_offset)}
            `)
        .style("fill", "none");

      svg.append("text")
        .attr("fill", "currentColor")
        .style("font-size", "12px")
        .attr("fill","white")
        .attr("opacity", 0.8)
        .append("textPath")
          .attr("xlink:href", "#textPath_"+text)
          .attr("startOffset", offset)
          .text(text);
    }
    // draw_stakeholder(0, 4, "50%", "Resident", "lightcoral");
    // draw_stakeholder(5, 9, "50%", "Workforce", "skyblue");
    // draw_stakeholder(10, 12, "20%", "Government & Developer", "lightgreen");


    // Draw slogan
    svg.append("text")
      .attr("dy", "-0.4em") // align with circle's cy
      .attr("text-anchor", "middle") // center the text
      .attr("dominant-baseline", "middle") // vertically align the text
      .style("font-size", "15px")
      .attr("fill","white")
      .attr("opacity", 0.8)
      .append("tspan")
        .text(title)
      .append("tspan")
        .attr("x", 0)
        .attr("dy", "1.5em")
        .text(subTitle);

    // Create a data layer
    const plots = svg.append('g')
      .selectAll('g')
      .data(data)
      .join('g')

    // Create a radial line generator
    const line = d3.lineRadial()
      .curve(d3.curveLinearClosed)
      .angle((d, i) => x(i));

    // Create a radial area generator
    const area = d3.areaRadial()
      .curve(d3.curveLinearClosed)
      .radius((d) => y(d))
      .angle((d, i) => i * angleSlice)

    // Draw min-max data area
    plots.append("path")
      .attr("fill", "#154C79")
      .attr("fill-opacity", 0.3)
      .attr("d", d => area
        .innerRadius((v) => y(v[0]))
        .outerRadius((v) => y(v[1]))
        (d.map((v) =>  [v.min,v.max])));

    // Draw mean data line
    plots.append('path')
        .attr("fill", "#F20075")
        .attr("fill-opacity", 0)
        .attr("stroke","#F20075")
        .attr("stroke-width", 3)
        .attr("stroke-opacity", 1)
        .attr("d", d => line
          .radius((v) => y(v))
          (d.map((v) => v.mean)))
        .on("mouseover", function(){
            d3.select(this)
              .attr("fill-opacity", 0.2)
          })
        .on("mouseout", function(){
            d3.select(this)
              .attr("fill-opacity", 0)
          });

    // Draw data marks
    plots.selectAll("circle")
      .data(d => d)
      .join("circle")
      .attr("r", dataCircleRadius)
      .attr("cx", (d,i) => d3.pointRadial(x(i), y(d.mean))[0])
      .attr("cy", (d,i) => d3.pointRadial(x(i), y(d.mean))[1])
      .attr("fill", "#F20075")
      .attr("fill-opacity", 1)
      .attr("stroke", "white")
      .attr("stroke-width", 2)
      .attr("opacity", 1)
      .on("mouseover", function(e,d){
        d3.select(this)
          .attr("r", dataCircleRadius*1.5)
        const hoveredCircle = d3.select(this);
        plots.append("text")
          .attr("opacity", 1)
          .text(d.mean.toFixed(2))
          .attr("fill", "currentColor")
          .style("font-size", "15px")
          .attr("fill","white")
          .attr("x", hoveredCircle.attr("cx"))
          .attr("y", hoveredCircle.attr("cy"))
          .attr("dy", "-1em");
      })
      .on("mouseout", function(e,d){
        d3.select(this)
          .attr("r", dataCircleRadius)
        plots.selectAll("text").remove();

    });

  }, [data]);

  return <svg ref={ref}></svg>;
};

export default IndexChart;

import React, { useState, useEffect } from 'react';
import * as Icon from '@mui/icons-material';
import { Box, Button, TextField, Stack, MenuItem } from '@mui/material';
import {
  GridRowModes,
  DataGrid,
  GridToolbarContainer,
  GridActionsCellItem,
  GridRowEditStopReasons,
} from '@mui/x-data-grid';
import { nanoid } from 'nanoid';
const {input,config,setConfig,setOutput} = props

function EditToolbar({ columns, rows, setRows, setRowModesModel, setColumns }) {
  const [columnFields, setColumnFields] = useState(config.columnFields || '');

  const handleAddRowClick = () => {
    const id = rows.length
    let emptyRow = {"id":id}
    columns.forEach(col=>{
      emptyRow[col.field]=''
    })
    setRows((oldRows) => [...oldRows, emptyRow]);
    setRowModesModel((oldModel) => ({
      ...oldModel,
      [id]: { mode: GridRowModes.Edit},
    }));
  };

  const handleAddColumnClick = () => {
    if (columnFields) {
      const columns = columnFields.split(',').map( col => ({
          field: col,
          headerName: col,
          width: 70,
          editable: true,
        })
      )
      setColumns(columns);
      setRows([])
      setConfig({...config, columnFields, columns})
    } else {
      alert('Please enter both field names seperate by ,');
    }
  };

  const handleRest = ()=>{
    setColumns([]);
    setRows([]);
  }

  return (
    <GridToolbarContainer>
      <Stack direction="row" spacing={0.5}  sx={{ width: '100%' }}>
            <TextField
            sx={{flex: 1 }}
            label="columns, e.g. name,type,value"
            variant="outlined"
            size="small"
            value={columnFields}
            onChange={(e) => setColumnFields(e.target.value)}
            />
            <Button
            variant="outlined"
            sx={{ fontSize: 10, flex: '0 0 80px' }}
            startIcon={<Icon.Add />}
            onClick={handleAddColumnClick}
            >
            Columns
            </Button>
            <Button
            variant="outlined"
            sx={{ fontSize: 10, flex: '0 0 80px' }}
            startIcon={<Icon.Add />}
            onClick={handleAddRowClick}
            >
            Row
            </Button>
            <Button
            variant="outlined"
            sx={{ fontSize: 10, flex: '0 0 80px' }}
            startIcon={<Icon.RestartAlt />}
            onClick={handleRest}
            >
            Reset
            </Button>
      </Stack>
    </GridToolbarContainer>
  );
}

export default function FormInput() {
  const initialRows = config?.rows || [
    {
      id: nanoid(),
      name: 'number',
      type: 'int',
      value: 100,
    },
  ];

  const actionColumn = {
      field: 'actions',
      type: 'actions',
      headerName: 'Actions',
      width: 70,
      cellClassName: 'actions',
      getActions: ({ id }) => {
        const isInEditMode = rowModesModel[id]?.mode === GridRowModes.Edit;

        if (isInEditMode) {
          return [
            <GridActionsCellItem
              icon={<Icon.Save />}
              label="Save"
              sx={{
                color: 'primary.main',
              }}
              onClick={handleSaveClick(id)}
            />,
            <GridActionsCellItem
              icon={<Icon.Cancel />}
              label="Cancel"
              className="textPrimary"
              onClick={handleCancelClick(id)}
              color="inherit"
            />,
          ];
        }

        return [
          <GridActionsCellItem
            icon={<Icon.Edit />}
            label="Edit"
            className="textPrimary"
            onClick={handleEditClick(id)}
            color="inherit"
          />,
          <GridActionsCellItem
            icon={<Icon.Delete />}
            label="Delete"
            onClick={handleDeleteClick(id)}
            color="inherit"
          />,
        ];
      },
    }

  const initialColumns = config.columns || [];

  const [rows, setRows] = useState(initialRows);
  const [columns, setColumns] = useState(initialColumns);
  const [rowModesModel, setRowModesModel] = useState({});

  const updateRow = () => {
    setConfig({ ...config, rows});
  };

  useEffect(() => {
    if (rows !== config.rows) {
      updateRow();
    }
  }, [rows]);

  useEffect(() => {
    if (columns !== config.columns) {
      setConfig({ ...config, columns });
    }
  }, [columns]);

  useEffect(()=>{
    setOutput({ output: rows });
  },[rows,config.run])

  const handleRowEditStop = (params, event) => {
    if (params.reason === GridRowEditStopReasons.rowFocusOut) {
      event.defaultMuiPrevented = true;
    }
  };

  const handleEditClick = (id) => () => {
    setRowModesModel({ ...rowModesModel, [id]: { mode: GridRowModes.Edit } });
  };

  const handleSaveClick = (id) => () => {
    setRowModesModel({ ...rowModesModel, [id]: { mode: GridRowModes.View } });
  };

  const handleDeleteClick = (id) => () => {
    setRows(rows.filter((row) => row.id !== id));
  };

  const handleCancelClick = (id) => () => {
    setRowModesModel({
      ...rowModesModel,
      [id]: { mode: GridRowModes.View, ignoreModifications: true },
    });

    const editedRow = rows.find((row) => row.id === id);
    if (editedRow.isNew) {
      setRows(rows.filter((row) => row.id !== id));
    }
  };

  const processRowUpdate = (newRow) => {
    const updatedRow = { ...newRow, isNew: false };
    setRows(rows.map((row) => (row.id === newRow.id ? updatedRow : row)));
    return updatedRow;
  };

  const handleRowModesModelChange = (newRowModesModel) => {
    setRowModesModel(newRowModesModel);
  };

  return (
    <Box
      sx={{
        height: '100%',
        width: '100%',
        '& .actions': {
          color: 'text.secondary',
        },
        '& .textPrimary': {
          color: 'text.primary',
        },
      }}
    >
      <DataGrid
        rows={rows}
        columns={[...columns,actionColumn]}
        size="small"
        editMode="row"
        rowHeight={20}
        columnHeaderHeight={30}
        columnBufferPx={50}
        rowModesModel={rowModesModel}
        onRowModesModelChange={handleRowModesModelChange}
        onRowEditStop={handleRowEditStop}
        processRowUpdate={processRowUpdate}
        disableColumnMenu
        disableColumnSorting
        hideFooter
        slots={{
          toolbar: EditToolbar,
        }}
        slotProps={{
          toolbar: { columns, rows, setRows, setRowModesModel, setColumns },
        }}
        sx={{
          '& .MuiDataGrid-footerContainer': {
            height: 30,
            minHeight: 30,
          },
          '& .MuiDataGrid-scrollbar': {
            display: 'none',
          },
        }}
      />
    </Box>
  );
}

