export default function DeckGLMap() {
    const deckGLref = useRef(null);
    const [layers, setLayers] = useState([]);
    const [viewState, setViewState] = useState({
        latitude: 42.3654825444308, 
        longitude: -71.09032464941119,
        zoom:  15,
        pitch: 0,
        bearing: 0,
        minZoom: 10,
        maxZoom: 22,
    });
    const [bbox, setBbox] = useState(null);

    const onBeforeRender = () => {
        const layer = layers[0];
        // fit the bounds of the layer
        if (layer && layer.isLoaded && bbox) {
            const viewport = layer.context.viewport;
            // fitBounds - Bounding box in [[longitude, latitude], [longitude, latitude]] format
            const formatedBounds = [[bbox[0], bbox[1]], [bbox[2], bbox[3]]];
            const {longitude, latitude, zoom} = viewport.fitBounds(formatedBounds);
            if (!(longitude === config.longtitude && latitude === config.latitude && zoom === config.zoom )){
            setViewState({...viewState,longitude, latitude, zoom:zoom-1});
            }
        }
    }

    useEffect(() => {
      if (!(input&&input.input)) return 
      const data = input.input;
      setBbox(turf.bbox(data));
      setLayers([TileBaseLayer(), GeoJsonBaseLayer({ data:data, opacity: 0.6 })]);
    }, [input]);

    return (
        <>
        {input && input.input &&
        <Box style={{width:config?.width, height:config?.height, position: 'relative', margin:0,padding:0}}>
            <DeckGL
            ref={deckGLref}
            initialViewState={viewState}
            onContextMenu={(e) => e.preventDefault()}
            onBeforeRender={onBeforeRender}
            layers={layers}
            controller={{
                type: MapController,
                dragRotate: true,
                dragPan: true,
                scrollZoom: true,
                touchZoom: true,
                touchRotate: true,
                keyboard: true,
                doubleClickZoom: true
            }}
            >
            </DeckGL>
        </Box>
        }
        </>
    );
}

